import React from 'react';
import LccLinkTile from './LccLinkTile';

export default function FormLayout() {
  return (
    <Form params={useParams()} navigate={useNavigate()} />
  );
}

class FormList extends React.Component {
  render() {
    let forms = null;

    switch (this.state.category) {
      case "ContactUs":
        forms = [
          new FormLinkData("/ContactUs/Description", "Contact Us Pathways")
        ];
        break;

      default:
        <p>test</p>;
        break;
    }

    return (
      <>
        <div class="text">
          <h1>On-line Services</h1>
        </div>

        <div class="groupPromo">
          <div class="listWebpart">
            <ul>
              {
                forms.map((element) => {
                  return (
                    <li>
                      <LccLinkTile to={element.to} header={element.header} description={element.description} />
                    </li>
                  );
                })
              }

            </ul>
          </div>
        </div>
      </>
    );
  }
}

class FormLinkData {
  constructor(to, category, header, description) {
    this.to = to;
    this.category = category;
    this.header = header;
    this.description = description;
  }
}
